import React from 'react'
import { useFetch } from 'src/hooks/useFetch'

import { Container, Role, User, Avatar } from './styles'

interface UserProps {
	nickname: string;
	isBot?: boolean;
}

interface User {
	userId: string;
	score: number;
  }

const UserRow: React.FC<UserProps> = ({ nickname, score }) => {
  return (
    <User>
      <Avatar className={isBot ? 'bot' : ''} />

      <strong>{nickname}</strong>
	  <span></span>

      {isBot && <span>Bot</span>}
    </User>
  )
}

const UserList: React.FC = () => {
  const { data } = useFetch<User[]>('http://localhost:4001/contests/global')

  return (
    <Container>
      <Role>Dispon√≠vel - 1</Role>
      { data ? data.map(function (element) {
        return <UserRow nickname={element.userId} score={element.score}/>
      })
        : <></>
      }
    </Container>
  )
}

export default UserList
